// Channels

import React from 'react';
import PropTypes from 'prop-types';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import Pagination from "react-js-pagination";
import './profile.scss';
import ReactPaginate from 'react-paginate';

const Profile = props => {
    return (
        <section className="profile">
            <div className="container">
            <Tabs>
            <TabList>
                <Tab onClick={() => {}} > <p>Thông tin tài khoản </p></Tab>
                <Tab onClick={() => {}}>Lịch sử đặt hàng</Tab>
                <Tab onClick={() => {}}>Tài khoản hoàn tiền</Tab>
                <Tab onClick={(e) => {
                    e.preventDefault();
                    props.logout()
                    }}>Đăng xuất</Tab>
            </TabList>           
            <TabPanel>
                <div className="row" style={{marginTop:'30px'}}>
                    <label className="col-md-2 mt-1" >Họ tên </label> <input  disabled="true" value={props.user && props.user.name}  className="form-control col-md-8" type="text" />
                </div>
                <div className="row" style={{marginTop:'10px',marginBottom:"10px"}}>
                    <label className="col-md-2 mt-1" >Email</label> <input  disabled="true"  value={props.user && props.user.email}  className="form-control col-md-8" type="text" />
                </div>
                <div className="row" style={{marginTop:'10px',marginBottom:"10px"}}>
                    <label className="col-md-2 mt-1" >Số điện thoại</label> <input type="number" value={props.user && props.user.phone_number} className="form-control col-md-8" type="text" />
                </div>
                <button className="col-md-8 no-margin" onClick={ (e) => this.handleSubmitUpdate(e)}  style={{backgroundColor:"#ff9340"}} >Cập nhật</button>
           </TabPanel>
           <TabPanel>
            <div className="col-lg-3">
                    <select className="form-control" style={{marginBottom:"30px",marginLeft:"-10px"}} onChange={(e) => props.handleFilterChange(e)}>
                            <option value="" >Tất cả</option>
                            <option value="0">
                                Đang chờ duyệt
                            </option>
                            <option value="1">
                                Đã duyệt 
                            </option>
                            <option value="-1">
                                Bị từ chối
                            </option>
                    </select>
                </div>
               {
                
                <table style={{width:"100%",marginBottom:"30px"}}>
                   <tr>
                        <th>Tên đối tác</th>
                        <th>Giá đơn hàng</th>
                        <th>Tiền hoàn lại</th>
                        <th>Ngày giao dịch</th>
                   </tr>
                   {
                     
                       props.orderList && props.orderList.data && props.orderList.data.map((item,key) =>       
                           (
                            <tr>
                                <td>{item.merchant_name}</td>
                                <td>{item.payout_amount}</td>
                                <td>{item.est_cashback}</td>
                                <td>{item.conversion_time}</td>
                            </tr>
                           
                           )
                       )
                       
                   }    
               </table>   
               }

                { props.orderList.data && props.orderList.data.length > 0 &&
                    <Pagination
                            activePage={props.orderList && props.orderList.current_page}
                            itemsCountPerPage={props.orderList && props.orderList.per_page}
                            totalItemsCount={props.orderList && props.orderList.total}
                            onChange={props.handlePageChange}
                        />
                }
            
           </TabPanel>
           <TabPanel>

           </TabPanel>
            </Tabs>
            </div>
        </section>
    );
};

export default Profile;
